import React, { Component } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

class PriceChart extends Component {

  constructor(props) {
    super(props)
  }

  render() {
    return (
    <div>
      <LineChart width={700} height={420} data={this.props.data}
        margin={{top: 5, right: 30, left: 20, bottom: 5}}>
        <XAxis dataKey="timestamp"/>
        <YAxis label={{value:'yen', position: 'insideLeft', offset:20}} domain={['dataMin - 5', 'dataMax + 5']}/>
        <CartesianGrid strokeDasharray="3 3"/>
        <Tooltip/>
        <Legend>"avc"</Legend>
        <Line name={this.props.instrumentCode + ' price'} dataKey="price" stroke="#8884d8" activeDot={{r: 1}}/>
      </LineChart>
    </div>
    )
  }

}

export default PriceChart;
